    let alpha = new Set('abcdefghijklmnopqrstuvwxyz');
    for (let c of str.toLowerCase()) {
      alpha.delete(c);
      if (alpha.size == 0) return true;
    }
    return false;
  }

  if (allLetters(props.name)) {
    return true;
  } else {
    console.log(props.name);
    return false;
  }

  return (
    <div>
      <h3 className={classes.name}>{props.name}</h3>
    </div>
  );
};

